import React, { FunctionComponent } from "react";
import Styles from "./home.styles";

const TodoForm: FunctionComponent = () => (
  <Styles.Form.Container>
    <Styles.Form.TitleInput />
    <Styles.Form.DescriptionInput />
  </Styles.Form.Container>
);

export default TodoForm;
